#__nuxt_preview {
  height: 50px;
  display: flex;
  justify-content: center;
  align-items: center;
  gap: 10px;
  font-family: Helvetica, sans-serif;
  font-weight: 500;
  position: fixed;
  bottom: -60px;
  left: 0;
  right: 0;
  background: rgba(255, 255, 255, 0.3);
  color: black;
  backdrop-filter: blur(20px);
  border-top: 1px #eee solid;
  transition: bottom 0.3s ease-in-out;
  font-size: 16px;
  z-index: 10000;
}
#__nuxt_preview.__preview_ready {
  bottom: 0;
}

#__preview_background {
  position: fixed;
  top: 0;
  left: 0;
  z-index: 9000;
  width: 100vw;
  height: 100vh;
  background: rgba(255, 255, 255, 0.3);
  backdrop-filter: blur(8px);
}

#__preview_loader {
  position: fixed;
  display: flex;
  flex-direction: column;
  align-items: center;
  gap: 8px;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
  font-size: 1.4rem;
  z-index: 9500;
  color: black;
  font-family: system-ui, -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, Oxygen, Ubuntu, Cantarell, 'Open Sans', 'Helvetica Neue', sans-serif;
}
#__preview_loader p {
  margin: 10px 0;
}

.dark #__preview_background,
.dark-mode #__preview_background {
  background: rgba(0, 0, 0, 0.3);
}
.dark #__preview_loader,
.dark-mode #__preview_loader {
  color: white;
}

.preview-loading-enter-active,
.preview-loading-leave-active {
  transition: opacity 0.4s;
}
.preview-loading-enter,
.preview-loading-leave-to {
  opacity: 0;
}

#__preview_loading_icon {
  animation: spin 1s linear infinite;
}

.dark #__nuxt_preview,
.dark-mode #__nuxt_preview {
  background: rgba(0, 0, 0, 0.3);
  border-top: 1px #111 solid;
  color: white;
}
#__nuxt_preview svg {
  display: inline-block;
  width: 30px;
  height: 30px;
  color: black;
}
.dark #__nuxt_preview svg,
.dark-mode #__nuxt_preview svg {
  color: white;
}
button {
  cursor: pointer;
  border: 1px solid rgba(0, 0, 0, 0.2);
  padding: 4px 10px;
  border-radius: 3px;
  background: transparent;
  margin-left: 5px;
  margin-right: 8px;
  color: rgba(0, 0, 0, 0.8);
  font-size: 14px;
  line-height: 1rem;
  transition: none;
  text-align: center;
  font-weight: normal;
  box-shadow: none;
  display: inline-block;
  width: auto;
  margin: 0;
}
button:hover {
  color: rgba(0, 0, 0, 0.9);
  border-color: rgba(0, 0, 0, 0.4);
}
.dark-mode button,
.dark button {
  color: lightgray;
  border-color: rgba(255, 255, 255, 0.2)
}
.dark-mode button:hover,
.dark button:hover {
  color: white;
  border-color: rgba(255, 255, 255, 0.4)
}
#__nuxt_preview button:hover,
#__nuxt_preview button:focus {
  background: rgba(0, 0, 0, 0.1);
}
#__nuxt_preview button:active {
  background: rgba(0, 0, 0, 0.2);
}
.dark #__nuxt_preview button,
.dark-mode #__nuxt_preview button {
  border: 1px solid rgba(255, 255, 255, 0.2);
  color: rgba(255, 255, 255, 0.8);
}
.dark #__nuxt_preview button:hover,
.dark #__nuxt_preview button:hover,
.dark-mode #__nuxt_preview button:focus,
.dark-mode #__nuxt_preview button:focus {
  background: rgba(255, 255, 255, 0.1);
}
.dark #__nuxt_preview button:active,
.dark-mode #__nuxt_preview button:active {
  background: rgba(255, 255, 255, 0.2);
}

a {
  font-weight: 600;
}
#__nuxt_preview.__preview_refreshing svg,
#__nuxt_preview.__preview_refreshing span,
#__nuxt_preview.__preview_refreshing button {
  animation: nuxt_pulsate 1s ease-out;
  animation-iteration-count: infinite;
  opacity: 0.5;
}
@keyframes nuxt_pulsate {
  0% {
      opacity: 1;
  }
  50% {
      opacity: 0.5;
  }
  100% {
      opacity: 1;
  }
}

@keyframes spin {
  0% {
    transform: rotate(360deg);
  }
  100% {
    transform: rotate(0deg);
  }
}

